import { useState } from "react";
import { Navbar, Nav, Form, FormControl, Container } from "react-bootstrap";
import { Link } from "react-router-dom";

const MazeNavbar = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const handleToggleClick = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  const handleCloseDropdown = () => {
    setIsDropdownOpen(false);
  };

  return (
    <Navbar expand="md" className="mazeNavbar">
      <Container fluid>
        <Navbar.Brand as={Link} to="/home">
          <img
            className="navbarLogo"
            src={process.env.PUBLIC_URL + "/visual/png/Logo_on_dark.png"}
            alt="logo"
          />
        </Navbar.Brand>
        <Navbar.Toggle
          aria-controls="maze-nav"
          aria-expanded="false"
          aria-label="Toggle navigation"
          onClick={handleToggleClick}
        >
          <span className="bi bi-list" />
        </Navbar.Toggle>
        <Navbar.Collapse id="maze-nav">
          <Nav className="m-auto">
            <Nav.Item>
              <Nav.Link as={Link} to="/portfolio">
                Portfolio
              </Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link as={Link} to="/feed">
                Feed
              </Nav.Link>
            </Nav.Item>
          </Nav>
          <Form className="searchform d-none d-md-flex">
            <div className="form-group d-flex">
              <FormControl type="text" placeholder="Search" className="pl-3" />
              <span className="bi bi-search" />
            </div>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default MazeNavbar;
